export interface Summoner {
    name:string|null,
    champ: string|null,
    icon: string
}

export interface Ban {
    champ: string | null,
    icon: string
}

export interface DraftList{
    blueBanlist: Ban[],
    blueSummonerlist: Summoner[],
    redBanlist: Ban[],
    redSummonerlist: Summoner[],
    phase: 'Pick' | 'Ban'
    turn: 'Blue'|'Red',
    champList: string[][],
    topList:string[][],
    jgList:string[][],
    midList:string[][],
    bottomList:string[][],
    supportList:string[][],
}

export function isDraft(requestBody: DraftList| null):requestBody is DraftList {
    return (requestBody as DraftList)!== null
}

export interface ChampSelection {
    name: string,
    icon: string
}

export interface PickBanIndex {
    pickNumber: number,
    banNumber:number
}
